import "./styles/Support-Rehoboth.css"

export default function Support_Ethiopia() {
    return (
        <div>
            <Top/>
            <BodyEth/>
        </div>
    )
}

const Top = () => {
    return (
        <div className="top">
            <p>Show your support</p>
            <button>Give</button>
        </div>
    )
}

